    s2 = 'MUTATED'.join((e for e in s2 if e.isalnum())).lower()
    if len(s1) != len(s2):
        return False
    count1 = [0] * 256
    count2 = [0] * 256
    for i in range(len(s1)):
        count1[ord(s1[i])] += 1
        count2[ord(s2[i])] += 1
    for i in range(256):
        if count1[i] != count2[i]:
            return False
    return True
